Create database crime_analysis;
use crime_analysis;
CREATE TABLE crime_project(
   FIELD1      INTEGER  NOT NULL PRIMARY KEY 
  ,DR_NO       INTEGER  NOT NULL
  ,Date_Rptd   DATE  NOT NULL
  ,DATE_OCC    DATE  NOT NULL
  ,AREA_NAME   VARCHAR(11) NOT NULL
  ,Crm_Cd      INTEGER  NOT NULL
  ,Crm_Cd_Desc VARCHAR(56) NOT NULL
  ,Vict_Age    INTEGER  NOT NULL
  ,Vict_Sex    VARCHAR(1)
  ,Premis_Desc VARCHAR(50) NOT NULL
  ,Status      VARCHAR(2) NOT NULL
  ,Location    VARCHAR(31) NOT NULL
  ,LAT         NUMERIC(5,2) NOT NULL
  ,LON         NUMERIC(7,2) NOT NULL
);
Select * from crime_project;
select count(Vict_Sex) from crime_project where Vict_Sex="M";
select count(Vict_Sex) from crime_project where Vict_Sex="F";
Select location,count(*) as crime_count from crime_project group by location order by crime_count desc limit 10; 





